// SPDX-License-Identifier: MIT
pragma solidity ^0.8.10;

contract HibernationCalculatorV2 {

    // structs //
     struct HibernationInformation {
        string uuid;
        uint shellLength;
        uint weight;
        uint result;
        uint min;
        uint avg;
        uint max;
    }

    struct Map {
        string[] keys;
        mapping(string => HibernationInformation) values;
        mapping(string => bool) inserted;
    }

    // events //
    event AnimalAdded(
        string uuid,
        uint shellLength,
        uint weight,
        uint result,
        uint min,
        uint avg,
        uint max
    );

    // storage variables //
    Map private animals;

    constructor() {
        initializeContract();
    }

    // public methods //
    function addAnimal(
        string memory uuid,
        uint shellLength,
        uint weight,
        uint result,
        uint min,
        uint avg,
        uint max
    ) public {
        HibernationInformation memory hibernationData = HibernationInformation(
            uuid,
            shellLength,
            weight,
            result,
            min,
            avg,
            max
        );

        add(uuid, hibernationData);
        emit AnimalAdded(uuid, shellLength, weight, result, min, avg, max);
    }

    function getAnimalCount() public view returns (uint) {
        return getSize();
    }

    function getAnimalByUUID(string memory uuid) public view returns (HibernationInformation memory) {
        return getAnimal(uuid);
    }

    // private methods //
    function add(string memory key, HibernationInformation memory hibernationInformation) private {
        if (!animals.inserted[key]) {
            animals.keys.push(key);
            animals.inserted[key] = true;
        }
        animals.values[key] = hibernationInformation;
    }

    function getSize() private view returns (uint) {
        return animals.keys.length;
    }

    function getAnimal(string memory key) private view returns (HibernationInformation memory) {
        return animals.values[key];
    }

    function initializeContract() private {
        addAnimal(
            "923e1a57-4000-4cb2-8869-cb37e77a357d",
            12000000000000000000,
            11000000000000000000,
            3,
            257658000000000000000,
            303611000000000000000,
            350494000000000000000
        );
    }
}
